import { useState } from "react"
const Form = () => {
    const [addTodo, setAddTodo] = useState("")
    return (
        <div>
            <input type="text"
                onChange={(e) => setAddTodo(e.target.value)}
                value={addTodo}
            />
        </div>
    )
}

export default Form
